import './App.css';
import Dashboard from './Dashboard';
import Home from './Home';
import Navbar from './Navbar';

function App() {
  return (
    <div className="the-map">
      <Navbar/>
      <Dashboard/>
      <Home/>
    </div>
  );
}

export default App;
